import React from 'react';
import {picture} from './data/picture';
import './App.css';

function App() {
  return (
    <div className="App">
      <h1>{picture.title}</h1>
      <img src={picture.imageUrl} className="pictureName"/>
      <p>{picture.description}</p>
    </div>
  );
}

export default App;
